import React, { useEffect, useState } from 'react';
import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';

function App() {
  const [check, setCheck] = useState(true)

  function checkBox() {
    setCheck(prevCheck => !prevCheck)
  }

  return (
    <div>
      <h1>Radar Altimeter</h1>
      <div className='parent'>
        <img className='scale' src={scale}></img>
        <img className='flagImg' src={flagImg}></img>
        <img className='needle' src={needle}></img>
        <img className='cover' src={cover}></img>
        <div className='light'></div>
        <img className='bugImg' src={bugImg}></img>
      </div>
      <input className='checkbox' type='checkbox' onChange={checkBox} value={true} />
    </div>
  );
}

export default App;
